drop table if exists Instrument;
drop sequence if exists INSTRUMENT_SEQ;
create sequence INSTRUMENT_SEQ start with 1 increment by 50;
create table Instrument (
        instrumentType varchar(31) not null,
        id bigint not null,
        amountInOriginalCurrency decimal(19,2),
        brokerLei varchar(255),
        counterpartyLei varchar(255),
        dealDate timestamp,
        originalCurrency varchar(255),
        valueDate timestamp,
        isin varchar(255),
        quantity bigint,
        maturityDate timestamp,
        tracker varchar(255),
        direction varchar(255),
        strikeAmount decimal(19,2),
        primary key (id)
);
GRANT SELECT, INSERT, UPDATE, DELETE, TRUNCATE ON ALL TABLES IN SCHEMA public to inst;
GRANT SELECT, UPDATE ON ALL SEQUENCES IN SCHEMA public to inst;
TRUNCATE TABLE INSTRUMENT;
